INSERT INTO `universitas` (`IDUNIV`, `NAMA_UNIV`, `ALAMAT_UNIV`, `AKREDITASI_UNIV`, `INFOUMUM`, `WEBSITE`, `LOGO_UNIV`) VALUES
('IPBN', 'Institut Pertanian Bogor', 'Jl. Raya Darmaga Kampus IPB Darmaga Bogor 16680 Jawa Barat, Indonesia', 'A', 'IPB dibentuk secara resmi sejak 1 September 1963 berdasarkan Surat Keputusan Menteri Perguruan Tinggi dan Ilmu Pengetahuan No. 91 Tahun 1963 dan disahkan oleh Keputusan Presiden Republik Indonesia No. 279 Tahun 1965. Saat ini, IPB mempunyai sembilan fakultas yaitu Fakultas Pertanian, Fakultas Kedokteran Hewan, Fakultas Perikanan dan Ilmu Kelautan, Fakultas Peternakan, Fakultas Kehutanan, Fakultas Teknologi Pertanian, Fakultas Matematika dan Ilmu Pengetahuan Alam, Fakultas Ekonomi dan Manajemen, Fakultas Ekologi Manusia, Sekolah Bisnis, Sekolah Pascasarjana dan Sekolah Vokasi.', 'http://www.ipb.ac.id', NULL),
('ITSN', 'Insitut Teknologi Sepuluh Nopember', 'Jl.Raya ITS, Keputih, Sukolilo, Keputih, Sukolilo, Kota SBY, Jawa Timur 60111', 'A', 'Institut Teknologi Sepuluh Nopember (disingkat ITS) adalah perguruan tinggi negeri yang terletak di Surabaya. ITS awalnya didirikan oleh Yayasan Perguruan Tinggi Teknik (YPTT) yang diketuai oleh dr. Angka Nitisastro pada tanggal 10 November 1957.\r\n\r\nDies Natalis ITS pertama adalah 10 November 1960, sementara nama ITS mulai digunakan dalam Peraturan Pemerintah No. 9 tahun 1961 (ditetapkan tanggal 23 Maret 1961).\r\n', 'https://www.its.ac.id/', NULL);
