INSERT INTO `universitas` (`IDUNIV`, `NAMA_UNIV`, `ALAMAT_UNIV`, `AKREDITASI_UNIV`, `INFOUMUM`, `WEBSITE`, `LOGO_UNIV`) VALUES
('UKP', 'Universitas Kristen Petra', 'Jl.Siwalankerto 121 - 131 Surabaya', 'A', '	Universitas Kristen Petra (sering disingkat UK Petra atau UKP) adalah sebuah perguruan tinggi swasta nasional di Surabaya, Jawa Timur, Indonesia. Universitas ini didirikan pada tahun 1961 atas prakarsa dari beberapa pendiri PPPK Petra, sebuah yayasan pendidikan Kristen di Surabaya yang telah didirikan pada tahun 1951. Nama "Petra" berasal dari bahasa Yunani yang berarti "Batu Karang', 'http://www.petra.ac.id/', ),
('UNAR', 'Universitas Airlangga', 'Surabaya, Jawa Timur, Indonesia', NULL, 'Universitas Airlangga (disingkat UNAIR) adalah sebuah perguruan tinggi negeri yang terletak di Surabaya, Jawa Timur. Universitas ini didirikan tanggal 10 November 1954 bertepatan dengan hari pahlawan yang ke-9. Berdasarkan data 30 September 2015, terdapat 38.047 mahasiswa yang terdaftar di Unair.\r\nUniversitas Airlangga memiliki tiga kampus yang berbeda yaitu Kampus A, Kampus B dan Kampus C', 'https://www.unair.ac.id/', NULL),
('UNHS', 'Universitas Hasanudin', 'Jl. Perintis Kemerdekaan Km.10 \r\nMakassar, 90245. Sulawesi Selatan, Indonesia', NULL, ' \r\nTelp: +62411-586200, +62411-584200 \r\nFax: +62411-585188 ', 'https://www.unhas.ac.id/', NULL),
('UPDN', 'Universitas Padjajaran', 'Jl. Raya Bandung Sumedang Km. 21, Hegarmanah, Jatinangor, Kab. Sumedang, Jawa Barat 45363, Indonesia', 'A', 'Universitas Padjadjaran atau dikenal dengan singkatan Unpad merupakan salah satu perguruan tinggi negeri yang ada di Indonesia. Unpad berdiri pada 11 September 1957, dengan lokasi kampus di Bandung.', 'http://www.unpad.ac.id', NULL);
